import React from "react";
import { Link } from "react-router-dom";

import breadcrumbsImg from "../../assets/images/breadcrumbs/1.jpg";

const Breadcrumb = (props) => {
    const { pageTitle1 } = props;
    const { pageTitle2 } = props;
    const { pageTitle3 } = props;
    const { pageTitle4 } = props;
    const { pageTitle5 } = props;
    const { linkPageTitle1 } = props;
    const { linkPageTitle2 } = props;
    const { linkPageTitle3 } = props;
    const { linkPageTitle4 } = props;
    const { linkPageTitle5 } = props;

    return (
        <div className="react-breadcrumbs">
            <div className="breadcrumbs-wrap">
                <img className="desktop" src={breadcrumbsImg} alt="Breadcrumbs" />
                <img className="mobile" src={breadcrumbsImg} alt="Breadcrumbs" />
                <div className="breadcrumbs-inner">
                    <div className="container">
                        <div className="breadcrumbs-text">
                            <h1 className="breadcrumbs-title">{pageTitle1 ? pageTitle1 : ""}</h1>
                            <h1 className="breadcrumbs-title">{pageTitle2 ? pageTitle2 : ""}</h1>
                            <h1 className="breadcrumbs-title">{pageTitle3 ? pageTitle3 : ""}</h1>
                            <h1 className="breadcrumbs-title">{pageTitle4 ? pageTitle4 : ""}</h1>
                            <h1 className="breadcrumbs-title">{pageTitle5 ? pageTitle5 : ""}</h1>
                            <div className="back-nav">
                                <ul>
                                    <li>
                                        <Link to="/home">Home</Link>
                                    </li>
                                    <li>
                                        <Link to={linkPageTitle1}>{pageTitle1 ? pageTitle1 : ""}</Link>
                                        <Link to={linkPageTitle2}>{pageTitle2 ? pageTitle1 : ""}</Link>
                                        <Link to={linkPageTitle3}>{pageTitle3 ? pageTitle1 : ""}</Link>
                                        <Link to={linkPageTitle4}>{pageTitle4 ? pageTitle1 : ""}</Link>
                                        <Link to={linkPageTitle5}>{pageTitle1 ? pageTitle1 : ""}</Link>
                                    </li>
                                </ul>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Breadcrumb;
